import React from "react";
import { Star } from "../../common/Svg/Svg";
import "../FeedBacks/FeedBacks.scss";
//import FeedBackSlider from "../FeedBackSlider/FeedBackSlider";
import Slider from "react-slick";
const settings = {
    dots: false,
    infinite: false,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1//,
    //className: props.class class="feedbacks__slider feedbacks-slider"
};

// return (
//     <Slider {...settings}>
//         {props.children}
//     </Slider>
// );
export default function FeedBacks() {
    return (
        <section className="main__feedbacks feedbacks">
            <Slider {...settings}>
                <div className="feedbacks-slider__slide feedback">
                    <div className="feedback__content">
                        <div className="feedback__rating">
                            <div className="product__rating"><Star /><Star /><Star /><Star /><Star /></div>
                        </div>
                        <div className="feedback__text">
                            I have tried another product after using this one successfully,
                            and I am Back for good! The flavour, the lightness of the oil and the health benefits
                            I have gotten with this oil are amazing!
                        </div>
                        <div className="feedback__author"><span className="button-line"></span> Mary</div>
                    </div>
                </div>
            </Slider>
        </section>
    )
}

